descr:
Fica a pessoa jurídica supracitada intimada a:
Apresentar 
01-Cópia do contrato social, 
02-Cópia do cartão CNPJ;
03-Cópia da Guia de ART ou RRT, 
04-Plano de Gerenciamento de Resíduos em Serviços de Saúde;
05-Planta de situação;
06-Planta de fluxos;
07-Providenciar alterações na Planta Baixa conforme relatório de Análise de Projeto Arquitetônico.
